import React, {useEffect} from 'react';
import axios from "axios";

function MainCoursePage() {

    useEffect(() => {
        axios.get(`https://jsonplaceholder.typicode.com/users`)
            .then(res => {
                const courses = res.data;

            }).catch((error) => {
            console.log(error)
        })
    }, []);
    return (
        <div>
            COURSE PAGE
        </div>
    );
}

export default MainCoursePage;
